import React from 'react';
import { HashLink as Link } from 'react-router-hash-link';

const Navigation = () => {
  return (
    <nav className="nav">
      <ul>
        <li><Link smooth to="#hakkimda">Hakkımda</Link></li>
        <li><Link smooth to="#deneyim">Deneyim</Link></li>
        <li><Link smooth to="#egitim">Eğitim</Link></li>
        <li><Link smooth to="#yetenekler">Yetenekler</Link></li>
        <li><Link smooth to="#referanslar">Referanslar</Link></li>
      </ul>
    </nav>
  );
};

export default Navigation;
